import React from "react";
import studio from "../images/1x1.png";
import twoBedroom from "../images/2x2.png";
import threeBedroom from "../images/3x3.png";
import fourBedroom from "../images/4x4.png";
import test from '../images/thumbNailer.jpeg'



const FloorPlans = () => {

    return (
        <div>
            <h1>Floor plans</h1>
            <img src={studio} />
            <img src={twoBedroom} />
            <img src={threeBedroom} />
            <img src={fourBedroom} />
            <img src={test} />
        </div>
    );

}

export default FloorPlans;
